import {LOGIN_ROTE, MENU_ROUTE, REGISTRATION_ROUTE} from "./utils/const";
import Menu from "./Page/Menu";
import Auth from "./Page/Auth";

export const publicRoutes = [
    {
        path: MENU_ROUTE,
        Component: Menu
    },
    {
        path: LOGIN_ROTE,
        Component: Auth
    },
    {
        path: REGISTRATION_ROUTE,
        Component: Auth
    }
]
